2021-04-21T08:35:33+10:00 2021-04-21T08:35:33+10:00 2021-04-21T08:35:33+10:00

После распада СССР наша страна унаследовала впечатляющие заводские мощности и множество заводов по производству кабелей. Однако это преимущество характеризуется ограниченным сроком годности, ведь оборудование имеет свойство изнашиваться.

Сегодня даже специалисты испытывают затруднение при выборе стандартной кабельной продукции из-за огромного разброса в ее стоимости и качестве. Такая разница объясняется не только разным уровнем наценки и ответственности производителей, но и объективным состоянием этой отрасли промышленности. Нередко оборудование слишком старое и нуждается в ремонте, а восстановление его работоспособности выполняется кустарными методами, с использованием подручных инструментов. Это отрицательно сказывается на производственном процессе, поэтому многие заводы выпускают продукцию с нестабильным качеством.

Еще одним фактором выступает устаревание ГОСТов, разрабатывавшихся еще в советские годы. Поэтому при выборе нельзя ориентироваться на год основания предприятия, ведь зачастую новые заводы имеют ультрасовременное оснащение, позволяющее производить долговечную и качественную продукцию.

За последние десятилетия этот индустриальный сектор не избежал прогресса, что привело к появлению новых технологий производства кабелей и усовершенствованных, надежных изоляционных материалов, способных обеспечить полную пожаробезопасность. Поэтому, выбирая кабельную продукцию, стоит ориентироваться на современное заводское оснащение.

Летом 2016 г. по инициативе российской ассоциации «Электрокабель» и при поддержке «Росстандарта» была запущена программа «Кабель без опасности», в рамках которой непрерывно отслеживается качество кабельной продукции, продаваемой на отечественном рынке. За прошедшие годы проект доказал свою эффективность: усилиями проверяющих были выявлены десятки недобросовестных изготовителей и поставщиков, предлагавших потребителям кабели, не соответствующие требованиям действующих стандартов. Непрерывный мониторинг позволил составить рейтинг лучших российских и зарубежных брендов, который поможет в выборе хорошего силового кабеля для монтажа электропроводки и иных целей.

ЛУЧШИЕ РОССИЙСКИЕ ПРОИЗВОДИТЕЛИ КАБЕЛЯ

Отечественные бренды занимают лидирующее положение на национальном рынке. Они поставляют высококачественную продукцию, отвечающую международным требованиям и стандартам, по доступной цене.

АЛЬФАКАБЕЛЬ

Предприятие было основано в 2007 г. и характеризуется динамичным развитием, позволяющим ежегодно выпускать более 70 тысяч километров кабельно-проводниковой продукции. ООО «АЛЬФАКАБЕЛЬ» реализует кабели не только в России, но и в странах Таможенного союза. Высокотехнологичное оборудование и производственные мощности, занимающие более 10 тыс. м2, позволяют в кратчайшие сроки выпускать крупные партии долговечных и надежных кабелей.

Автоматизированное производство полного цикла, расположенное в городе Орел, отвечает стандартам экологической безопасности и ресурсосбережения. На каждом этапе – от закупки сырья до отгрузки готовой продукции – осуществляется строгий контроль качества в лабораторных условиях. Завод предлагает широкий модельный ряд проводов, силовых, монтажных и контрольных кабелей.

Плюсы:

непрерывное наращивание объемов производства;

качество и надежность;

свыше 400 типов продукции;

постоянное расширение ассортимента;

штат квалифицированных сотрудников;

строгое соблюдение обязательств перед партнерами;

сотрудничество с крупными сетевыми магазинами;

доступность на всей территории РФ;

наличие сертификатов;

ежегодный независимый аудит;

доступные цены;

соответствие требованиям ГОСТ и ISO.

Минусы:

отсутствуют.

ЭЛЕКТРОКАБЕЛЬ

Кольчугинский завод является одним из ведущих предприятий РФ в данном сегменте и поставляет изделия для металлургической, машиностроительной, нефтедобывающей, железнодорожной и других отраслей страны, а также зарубежным партнерам. Он был основан в 1871 году, успешно пережил военную эвакуацию, а в постсоветские годы был преобразован в OAO. Сегодня его номенклатурный перечень включает свыше 70.000 наименований. Кабели этого завода были закуплены Ираном для АЭС «Бушер» и получили множество наград.

Плюсы:

высококачественная продукция;

номенклатура включает изделия самого разного назначения;

новейшее производственное оснащение;

доступная стоимость.

Минусы:

отсутствуют.

КАМКАБЕЛЬ

«Камский кабель» является одним из крупнейших заводов РФ. Гигантские производственные мощности позволяют этому OAO выпускать широчайший ассортимент электропроводов (около 40 тыс. наименований). После распада CCCP предприятие было сильно модернизировано и получило современное оснащение, позволившее ему выйти на один уровень с передовыми иностранными компаниями. Наличие собственного контрольно-испытательного центра позволяет выполнять тщательный контроль качества продукции. Штат состоит из высококвалифицированных работников, также здесь предусмотрена программа переобучения и повышения квалификации.

Плюсы:

соответствие кабелей российским и международным стандартам;

применяется высококачественное сырье;

крупномасштабное производство;

невысокая стоимость.

Минусы

отсутствуют.

СЕВКАБЕЛЬ

Это один из крупнейших петербургских заводов, построенный еще в 1879 г. Даже в блокадные годы он не останавливал работу: именно благодаря произведенному им огромному подводному кабелю протяженностью 100 км жители Ленинграда обеспечивались электроэнергией. В 2007 году завод обзавелся единственным в России резиносмесительным комплексом.

Плюсы

героическая история;

до 20.000 маркоразмеров;

изоляция изготавливается по немецким технологиям;

взрывобезопасность.

Минусы

дороговизна некоторых узкоспециализированных типов кабеля.

МОСКАБЕЛЬМЕТ

Еще один бренд с вековой историей. Он появился в 1895 году и к сегодняшнему дню превратился в концерн, объединивший под одним названием несколько заводов. Помимо обычных проводов, рассчитанных на 1 кВт, номенклатура включает силовые кабели свыше 100 кВт. Под этой маркой в основном выпускается неизолированный провод, предназначенный для воздушных ЛЭП. Также в ассортимент входит кабель с изоляцией, провода для обмотки и оптоволокно.

Плюсы

наличие сертификата Министерства обороны РФ;

лучшие провода без изоляции;

высококачественная продукция.

Минусы

дороговизна;

постепенное сужение ассортимента.

РЫБИНСККАБЕЛЬ

Предприятие основано в 1949 г. и на сегодняшний день является частью объединения «Москабель». Неоднократно получало награды и попадало в топ-10 крупнейших заводов СНГ. Помимо выпуска широкого ассортимента кабелей, его специализацией является переработка меди. На заводе работают свыше 1.600 сотрудников. Среди крупнейших заказчиков числятся корпорации «Росатом», «Лукойл», «Газпром» и др. Завод имеет дополнительные производственные площадки в регионах.

Плюсы

низкие цены;

наличие огнестойких изделий;

нетоксичная продукция;

огромная производственная мощность.

Минусы

неопытный обслуживающий персонал.

СПЕЦКАБЕЛЬ

Это относительно молодое предприятие, появившееся в 1997 году и занимающееся выпуском узкоспециализированной продукции, поставляемой, в том числе, в Минобороны. Наличие собственной научно-технической базы и ультрасовременного оборудования позволило нарастить клиентскую базу, которая насчитывает около 10 тыс. заказчиков. Сегодня завод предлагает свыше 6000 марок кабелей, в том числе огнестойкие, радиочастотные и др.

Плюсы

новейшее оснащение;

наличие испытательного центра;

редкие типы кабелей.

Минусы

узкий ассортимент.

ТАТКАБЕЛЬ

Завод был открыт менее 10 лет назад, однако успел превратиться в один из ключевых производственных объектов отечественной энергетической отрасли. Форма собственности завода – OOO, а сам он является частью группы компаний «ИНВЭНТ». Его отличает передовое оснащение и крупномасштабное производство, позволяющее изготавливать кабели с площадью сечения до 2500 кв. мм, рассчитанные на работу под напряжением до 500 киловольт. Штат состоит из нескольких сотен работников.

Плюсы

строгий контроль качества;

наличие инжинирингового и испытательного центра;

много запатентованных разработок;

независимость от импортируемого сырья;

герметичные, негорючие кабели;

участие в крупных строительных проектах.

Минусы

специализация на промышленных типах кабеля, отсутствие «бытовых» товаров.

СКК

ЗАО «Самарская кабельная компания» в советские годы называлось Куйбышевским заводом кабелей связи, но, несмотря на смену названия, сохранило лучшие традиции и известность на российском рынке. Передовое оборудование известных производителей из Европы позволяет осуществлять выпуск кабелей любого назначения.

Плюсы

строгий контроль качества;

многошаговое тестирование продукции;

собственный испытательный центр;

полное соответствие ГОСТ;

высокое качество и надежность.

Минусы

узкий ассортимент.

КОНКОРД

Компания специализируется на выпуске высококачественных силовых кабелей из меди. Кроме того, ассортимент включает бронированный кабель и кабельную продукцию, не поддерживающую горение. Форма собственности – OOO.

Плюсы:

сотрудничество с крупными заказчиками;

строгое соблюдение нормативов и стандартов;

ценовая политика;

наличие наград.

Минусы:

небогатый ассортимент.

АГРОКАБЕЛЬ

Изначально компания, основанная в 1989 году, специализировалась на производстве кабелей для нужд сельского хозяйства. Сегодня ее основной специализацией является выпуск алюминиевых проводов без изоляции, предназначенных для воздушных ЛЭП. Также компания производит силовые, бронированные, негорючие кабели и многое другое, всего около 3000 наименований. ЗАО «Агрокабель» поставляет товары во все субъекты РФ и страны СНГ, а также прибалтийские и ближневосточные страны.

Плюсы

наличие всех требуемых лицензий и сертификатов;

лучшее предложение в бюджетном ценовом сегменте;

достойное качество;

сотрудничество с зарубежными заказчиками;

высокая надежность.

Минусы

скромный ассортимент.

АЛЮР

Предприятие было образовано в 2006 г., но за прошедшее время успело выйти в лидеры отечественного рынка благодаря программе переоснащения и непрерывному расширению ассортимента. Сегодня компания предлагает около 300 номенклатурных позиций товаров и 12.000 маркоразмеров. В каталоге можно найти провода бытового назначения и силовые кабели по умеренным ценам. Фирма регулярно принимает участие в выставочных мероприятиях отраслевого характера.

Плюсы

демократичная ценовая политика;

соответствие ГОСТ и иным стандартам качества;

наличие сертификатов;

широчайший ассортимент;

минимальные сроки поставки;

высокая прочность.

Минусы

чрезмерная жесткость жил.

САРАНСККАБЕЛЬ

Завод начал работу в далеком 1955 г. В постсоветские годы он был преобразован в ООО, но сохранил традиции высокого качества. Сегодня предприятие выпускает современные кабельные изделия на новейшем высокотехнологичном оборудовании. Каталог включает широчайший выбор кабельно-проводниковой продукции, предназначенной для промышленного использования (металлургической, радиотехнической и авиационной отрасли, а также химзаводов).

Плюсы

доступная стоимость;

поэтапный контроль качества;

пожаробезопасность;

наличие российских и международных сертификатов;

огромный ассортимент.

Минусы

несоблюдение оговоренных сроков поставки.

ТОМСККАБЕЛЬ

Достаточно молодая, но быстроразвивающаяся фирма с внушительным парком передового оборудования и 102 производственными линиями. Появилась в 2000 г. и за это время успела наработать базу постоянных заказчиков в 46 субъектах России и 10 иностранных государствах. Производит широкий ассортимент самых популярных типов электротехнической продукции и непрерывно расширяет номенклатуру товаров с учетом потребительских предпочтений. Выпускает провода NUM в пластиковой оболочке, силовые, бронированные кабели и др.

Плюсы

современные автоматизированные линии;

строгий многоэтапный контроль качества;

широкая география поставок внутри РФ и за рубежом;

хорошая обратная связь с клиентами.

Минусы

узкий ассортимент.

ЛУЧШИЕ ЗАРУБЕЖНЫЕ ПРОИЗВОДИТЕЛИ КАБЕЛЯ

Иностранные изготовители из ближнего и дальнего зарубежья внедряют самые прогрессивные разработки и технологии. Их товары можно охарактеризовать как высоконадежные, качественные и долговечные, но стоимость не всегда подходит для российского потребителя.

TITANEX

Гибкие кабели индустриального назначения этой марки востребованы во всем мире. Бренд принадлежит компании NEXANS, однако заводские мощности разбросаны по всей Европе. На российский рынок этот гигант пришел более десятилетия назад. Электропровода TITANEX рассчитаны на эксплуатацию в экстремальных условиях.

Плюсы

безупречное качество;

долговечность;

собственные НИИ;

использование прогрессивных технологий.

Минусы

отсутствуют.

ARISTONCAVI

Предприятие базируется в Италии и с момента основания в 1958 году успело разрастись с 1.600 м2 до 35.000 м2. Кроме производственных площадок завод имеет склады и выпускает кабели в резиновой оболочке. Сегодня бренд является признанным лидером в сфере производства узкоспециализированной продукции для нефтяного сектора, авиапромышленности и здравоохранения. Несмотря на достигнутый успех, компания продолжает вкладывать средства в переоснащение и разработку новых разновидностей кабелей.

Плюсы

приемлемые цены;

уникальность выпускаемых товаров;

наличие собственных разработок;

прогрессивные технологии.

Минусы

отсутствуют.

LAPP KABEL

Изначально немецкая компания, появившаяся в 1957 году, сегодня имеет множество филиалов за рубежом. Ее основатель Оскар Лапп стал изобретателем технологии массового выпуска гибкого кабеля под названием OLFLEX. В 2005 году бренд вышел на российский рынок и предлагает огромный выбор высокопрочных проводов для разных отраслей, в том числе подводные, термостойкие кабели и изделия для грузоподъемных механизмов.

Плюсы

безупречное качество;

широкая линейка товаров;

уникальные технологии;

гибкость и прочность.

Минусы

дороговизна.

HELUKABEL

Бренд, возникший в 1978 году, сегодня лидирует среди европейских производителей и имеет заводы не только в Евросоюзе, но и многих иных государствах. Продукция отвечает международным требованиям. На всех заводах компании – от Швеции и Голландии до Индии и КНР – действует строгий контроль качества. Кабели этой торговой марки популярны среди российских покупателей.

Плюсы

приемлемые цены;

контроль качества в сочетании с лабораторными испытаниями;

наличие товаров для любых сфер использования;

множество филиалов по всему миру.

Минусы

неразвитость дилерской сети в РФ.

NEXANS (Нексанс Россия)

Это один из старейших производителей Франции, появившийся в XIX веке и со временем превратившийся в транснациональную корпорацию. По объемам выпуска занимает второе место в мире. В 2008 г. концерн начал поставлять кабели бытового и промышленного назначения на отечественный рынок, одновременно открыв филиал в Ярославской области и инвестировав в заводские мощности около €45 млн. Кроме кабелей для «домашней» проводки и ЛЭП бренд предлагает ультрасовременную огнезащищенную продукцию для индустриальных объектов с повышенными требованиями к огнестойкости и пожаробезопасности.

Плюсы

доступные цены благодаря частичной локализации производства;

широкая линейка моделей;

наличие кабелей, выдерживающих экстремальные условия эксплуатации;

качество, долговечность, надежность.

Минусы

дороговизна импортируемых изделий.

ЮЖКАБЕЛЬ

Предприятие было образовано в УССР в 1943 г. и к сегодняшнему дню превратилось в одного из крупнейших производителей кабелей на просторах бывшего CCCP. ПАО «ЮЖКАБЕЛЬ» поставляет продукцию в 20 стран, используя собственную службу доставки. Украинский завод выпускает изделия для АЭС, отрасли нефтедобычи, народнохозяйственного комплекса и др. В каталоге представлено свыше 25.000 маркоразмеров, соответствующих требованиям ISO-9001.

Плюсы

превосходное качество;

широкий выбор номенклатурных позиций;

доступная стоимость.

Минусы

есть риск наткнуться на подделку.

Заключение

Кабель – это намного больше, чем просто металлические жилы в оболочке, поэтому к выбору данной продукции надо подходить с умом. К сожалению, даже лучшие компании не уделяют достаточного внимания работе с розничными покупателями, поэтому приходя в торговую сеть или специализированный магазин, нельзя получить гарантии качества, ведь до того, как попасть к конечному потребителю, товар может пройти через множество посредников. Вот почему никто не сможет гарантировать подлинность кабеля.

Низкокачественная продукция не только может иметь уменьшенное сечение, что неизбежно приводит к перегреванию и падению напряжения в электросети даже при стандартной нагрузке, но и ненадежную, небезопасную изоляцию, или неправильный химический состав материала жил. Недобросовестные изготовители могут использовать при производстве вторсырье, а это увеличивает показатели сопротивления и окисляемость кабельных жил.

Вследствие неудовлетворительного качества может возникнуть возгорание, а неправильная оболочка проводов – усилить пламя и привести к задымлению, а также тяжелому отправлению наглотавшихся дыма людей из-за наличия токсичных компонентов в составе. Однако если рядом отсутствует официальный дилер надежного изготовителя с хорошей репутацией, придется сделать пробную закупку и протестировать кабель самостоятельно.

Приобретенное изделие нужно взвесить, чтобы понять, соответствует ли вес жил заявленному, а также замерить сечение и толщину изоляционной оболочки, сопоставив с требованиями действующих стандартов. Малейший «недовес» или уменьшенное сечение жил говорят об очевидной подделке. Ориентируясь на эти признаки, вы сможете определить фальсифицированный продукт, не отвечающий современным нормативам. Пользоваться такой продукцией не стоит, ведь «находчивый» изготовитель мог удешевить производство за счет некачественного сплава и ненадежной оболочки. Такой провод прослужит максимум пару сезонов, а потом обязательно выйдет из строя, и повезет, если обойдется без пожара.

Эксперты сходятся в том, что товар, поставляемый из Китая, приобретать не стоит. Безусловно, большие государственные корпорации КНР выпускают продукцию, ничем не уступающую лучшим мировым брендам, но ее трудно найти в рознице. А менее известных марок, которых в избытке на отечественных прилавках (около 25% рынка в РФ), специалисты рекомендуют остерегаться, так как они далеко не всегда соблюдают стандарты.
